// src/pages/profile.jsx
import React, { useEffect, useState } from "react";
import { getProfile, saveProfile } from "../api";
import { Link, useNavigate } from "react-router-dom";

export default function Profile() {
  const [profile, setProfile] = useState({
    domain: "",
    role: "",
    experience: "",
    location: "",
    visa_sponsorship: "",
    work_mode: ""
  });
  const [loading, setLoading] = useState(true);
  const [msg, setMsg] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    let mounted = true;
    (async () => {
      try {
        const data = await getProfile();
        if (mounted && data) {
          // Normalize fields (backend may return keys differently)
          setProfile({
            domain: data.domain || data.domains || "",
            role: data.role || (data.roles && data.roles[0]) || "",
            experience: data.experience || data.years_experience || "",
            location: data.location || "",
            visa_sponsorship: data.visa_sponsorship === undefined ? (data.visa_required || "") : String(data.visa_sponsorship),
            work_mode: data.work_mode || (data.work_modes && data.work_modes[0]) || ""
          });
        }
      } catch (e) {
        console.warn("fetch profile failed", e);
        // if unauthorized, api already redirects
      } finally {
        if (mounted) setLoading(false);
      }
    })();
    return () => (mounted = false);
  }, []);

  async function submit(e) {
    e.preventDefault();
    setMsg("Saving...");
    const res = await saveProfile(profile);
    if (res && res.success) {
      setMsg("Saved successfully");
      // go to dashboard after saving preferences
      setTimeout(() => navigate("/dashboard"), 600);
    } else {
      setMsg("Failed to save profile");
    }
  }

  if (loading) return <div className="container">Loading...</div>;

  return (
    <div className="container">
      <nav>
        <Link to="/dashboard">Dashboard</Link> | <Link to="/profile">Profile</Link>
      </nav>

      <h2>Your Preferences</h2>
      <form onSubmit={submit}>
        <input placeholder="Domain (e.g., Data Science)" value={profile.domain} onChange={(e)=>setProfile({...profile, domain:e.target.value})} />
        <input placeholder="Role (e.g., Data Scientist)" value={profile.role} onChange={(e)=>setProfile({...profile, role:e.target.value})} />
        <input placeholder="Experience (years)" type="number" value={profile.experience} onChange={(e)=>setProfile({...profile, experience:e.target.value})} />
        <input placeholder="Location" value={profile.location} onChange={(e)=>setProfile({...profile, location:e.target.value})} />
        <select value={profile.work_mode} onChange={(e)=>setProfile({...profile, work_mode:e.target.value})}>
          <option value="">Work mode</option>
          <option value="Remote">Remote</option>
          <option value="Hybrid">Hybrid</option>
          <option value="Onsite">Onsite</option>
        </select>

        <select value={profile.visa_sponsorship} onChange={(e)=>setProfile({...profile, visa_sponsorship:e.target.value})}>
          <option value="">Visa sponsorship?</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>

        <button type="submit">Save preferences</button>
      </form>

      {msg && <p>{msg}</p>}
    </div>
  );
}
